import React, { Component } from "react";
import './App.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from "./components/Navbar";
import Section from "./components/Section";
import dummyText from "./dummyText";

class App extends Component {
  render() {
    return (

            <div className="App">
                <Navbar />
                <Section title="block-1" subtitle={dummyText} dark={true} id="section1" />
                <Section title="block-2" subtitle={dummyText} dark={false} id="section2" />
                <Section title="block-3" subtitle={dummyText} dark={true} id="section3" />
                <Section title="block" subtitle={dummyText} dark={false} id="section4" />
                <Section title="block" subtitle={dummyText} dark={true} id="section5" />
            </div>


        );
      }
    }

export default App;
